// Session: Session - Obiekt sesji dający dostęp do wszystkich danych programu

public string Feature_Operacje_poprzedzające
{
get
{
var kody = new List<string>();
foreach(var opLink in Row.OperacjePoprzedzajace)
{
kody.Add(opLink.Poprzedzajaca.Kod);
}
return string.Join(",", kody.ToArray());
}
}
