DefinicjaCeny.Metoda:
public void Przelicz_Hurtowa()
{
ICena cena = Policz("Podstawowa");
Netto  = cena.Netto*(Percent.Hundred+Towar.Narzut);
Brutto = Netto*(Percent.Hundred+Towar.ProcentVAT);
StandardowaIlosc = cena.StandardowaIlosc;
}

public void Przelicz_Detaliczna()
{
ICena cena = Policz("Hurtowa");
Netto  = cena.Netto/(Percent.Hundred - Towar.Marza);
Brutto = Netto*(Percent.Hundred+Towar.ProcentVAT);
StandardowaIlosc = cena.StandardowaIlosc;
}

public void Przelicz_Ewidencyjna()
{
Netto  = 0;
Brutto = 0;
StandardowaIlosc = new Quantity(1, Towar.Jednostka.Kod);
}
